import React from "react";
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome';

import "./Footer.css";

const Footer = props => {
    return (
        <footer className={props.className}>
            <i className="fab fa-facebook-square"></i>
        </footer>
    );
};

export default Footer;
